import React, { useState, ChangeEvent } from "react";
import 'bootstrap/dist/css/bootstrap.css';
import './signUp.css';

function SignUp() {
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [passwordMatch, setPasswordMatch] = useState(true);

  const handlePasswordChange = (e: ChangeEvent<HTMLInputElement>) => {
    setPassword(e.target.value);
    setPasswordMatch(e.target.value === confirmPassword);
  };

  const handleConfirmPasswordChange = (e: ChangeEvent<HTMLInputElement>) => {
    setConfirmPassword(e.target.value);
    setPasswordMatch(e.target.value === password);
  };

  return (
    <div className="sign_up_container">
      <div className="mb-3 sign_up_input">
        <label htmlFor="inputUserName" className="form-label">User Name</label>
        <input type="text" className="form-control" id="inputUserName" name="userName" />
      </div>

      <div className="mb-3 sign_up_input">
        <label htmlFor="inputPassword" className="form-label">Password</label>
        <input type="password" className="form-control" id="inputPassword" name="password" value={password} onChange={handlePasswordChange} />
      </div>

      <div className="mb-3 sign_up_input">
        <label htmlFor="inputConfirmPassword" className="form-label">Confirm Password</label>
        <input type="password" className="form-control" id="inputConfirmPassword" name="confirmPassword" value={confirmPassword} onChange={handleConfirmPasswordChange} />
        {confirmPassword != "" && (passwordMatch ? <p className="text-success">Good To Go</p> : <p className="text-danger">Passwords do not Match</p>)}
      </div>
    </div>
  );
}

export default SignUp;
